private convertToLatLngLiteral(array: any): Array<LatLngLiteral> {
  let result: Array<LatLngLiteral> = new Array<LatLngLiteral>();
  for (let coords of array) {
    result.push({
      lat: coords[0],
      lng: coords[1]
    });
  }
  console.log("conversion success")
  return result;
}


